;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.simple-sr/result</span>","value":"#'algebolic.demo.simple-sr/result"}
;; <=

;; @@
(plot/list-plot (:min (:error @metrics)) :joined true)
