;; @@
(def run-config
  (let [vars '[x]
        functions (expression/get-function-symbols #{:plus :minus :times})
        terminals (expression/make-terminals vars)
        size-limit 128
        ea-config (sso/sso-ea-config
                    {:tournament-size 3
                     :goal :error
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 40}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation functions terminals 5) :repeat 5}
                                 {:op identity :repeat 5}]})
        score-functions {:complexity score/size
                         :error (partial score/chi-squared vars data-sin)
                         ;;:error-pp (partial score/chi-squared-pp vars data-sin 0.001)
                         }]
    {:initial-zeitgeist      (evolution/make-zeitgeist
                               (genetics/ramped-half-and-half-population functions terminals 100 6))
     :ea-config              ea-config
     :score-functions        score-functions
     :transformations        [(partial transform/apply-to-fraction
                                       (partial transform/hill-descent
                                                genetics/twiddle-constants
                                                (:error score-functions))
                                       0.5)
                              #(map (partial transform/apply-to-genotype
                                             (partial genetics/trim-hard size-limit)) %)]
     :stopping-condition     #(>= (:age %) 500)
     :reporting-function     (fn [z] (print ".") (flush))}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.simple-sr/run-config</span>","value":"#'algebolic.demo.simple-sr/run-config"}
;; <=

;; @@
(def result (evolution/run-evolution run-config metrics))
